import { bebidas, carnes, frios, higiene, hotifruti,
  laticinios, limpeza, padaria} from '../services/datas'

const subcategoryObj = {
  categoria: [],
  Bebidas: bebidas,
  Carnes: carnes,
  Frios: frios,
  Higiene: higiene,
  Hortifruti: hotifruti,
  Laticínios: laticinios, 
  Limpeza: limpeza,
  Mercearia: ["akiki","sdt5t5tsd", "asasaikiksas"], 
  Padaria: padaria, 
  PetShop: ["ajtyu5676","sdst5t5d", "asasasas"], 
  Utilidades_Domésticas: ["a","sdskiikd", "asaikikisasas"],
  Outros: [],
}


export default function subCategory(category) {
  return subcategoryObj[category];
}
